webpackJsonp([291],{"./node_modules/json-loader/index.js!./.cache/json/api-complex-html.json":function(e,n){e.exports={data:{file:{relativePath:"api/Complex.html",childRawHtml:{content:'<div class="ocamldoc">\n<div class="navbar"><a class="pre" href="Char.html" title="Char">Previous</a>\n&#xA0;<a class="up" href="index.html" title="Index">Up</a>\n&#xA0;<a class="post" href="Digest.html" title="Digest">Next</a>\n</div>\n<h1>Module <a href="type_Complex.html">Complex</a></h1>\n\n<pre><span class="keyword">module</span> Complex: sig .. end</pre><div class="info module top">\nComplex numbers.\n<p>\n\n    This module provides arithmetic operations on complex numbers.\n    Complex numbers are represented by their real and imaginary parts\n    (cartesian representation).  Each part is represented by a\n    double-precision floating-point number (type <code class="code">float</code>).<br>\n</p></div>\n<hr width="100%">\n\n<pre><span class="keyword">type</span> t = {</pre><table class="typetable">\n<tbody><tr>\n<td align="left" valign="top">\n<code>&#xA0;&#xA0;</code></td>\n<td align="left" valign="top">\n<code>re&#xA0;: float;</code></td>\n\n</tr>\n<tr>\n<td align="left" valign="top">\n<code>&#xA0;&#xA0;</code></td>\n<td align="left" valign="top">\n<code>im&#xA0;: float;</code></td>\n\n</tr></tbody></table>\n}\n\n<div class="info ">\nThe type of complex numbers.  <code class="code">re</code> is the real part and <code class="code">im</code> the\n    imaginary part.<br>\n</div>\n\n\n<pre id="VALzero">val zero : t</pre><div class="info ">\nThe complex number <code class="code">0</code>.<br>\n</div>\n\n<pre id="VALone">val one : t</pre><div class="info ">\nThe complex number <code class="code">1</code>.<br>\n</div>\n\n<pre id="VALi">val i : t</pre><div class="info ">\nThe complex number <code class="code">i</code>.<br>\n</div>\n\n<pre id="VALneg">val neg : t -&gt; t</pre><div class="info ">\nUnary negation.<br>\n</div>\n\n<pre id="VALconj">val conj : t -&gt; t</pre><div class="info ">\nConjugate: given the complex <code class="code">x + i.y</code>, returns <code class="code">x - i.y</code>.<br>\n</div>\n\n<pre id="VALadd">val add : t -&gt; t -&gt; t</pre><div class="info ">\nAddition<br>\n</div>\n\n<pre id="VALsub">val sub : t -&gt; t -&gt; t</pre><div class="info ">\nSubtraction<br>\n</div>\n\n<pre id="VALmul">val mul : t -&gt; t -&gt; t</pre><div class="info ">\nMultiplication<br>\n</div>\n\n<pre id="VALinv">val inv : t -&gt; t</pre><div class="info ">\nMultiplicative inverse (<code class="code">1/z</code>).<br>\n</div>\n\n<pre id="VALdiv">val div : t -&gt; t -&gt; t</pre><div class="info ">\nDivision<br>\n</div>\n\n<pre id="VALsqrt">val sqrt : t -&gt; t</pre><div class="info ">\nSquare root.  The result <code class="code">x + i.y</code> is such that <code class="code">x &gt; 0</code> or\n    <code class="code">x = 0</code> and <code class="code">y &gt;= 0</code>.\n    This function has a discontinuity along the negative real axis.<br>\n</div>\n\n<pre id="VALnorm2">val norm2 : t -&gt; float</pre><div class="info ">\nNorm squared: given <code class="code">x + i.y</code>, returns <code class="code">x^2 + y^2</code>.<br>\n</div>\n\n<pre id="VALnorm">val norm : t -&gt; float</pre><div class="info ">\nNorm: given <code class="code">x + i.y</code>, returns <code class="code">sqrt(x^2 + y^2)</code>.<br>\n</div>\n\n<pre id="VALarg">val arg : t -&gt; float</pre><div class="info ">\nArgument.  The argument of a complex number is the angle\n    in the complex plane between the positive real axis and a line\n    passing through zero and the number.  This angle ranges from\n    <code class="code">-pi</code> to <code class="code">pi</code>.  This function has a discontinuity along the\n    negative real axis.<br>\n</div>\n\n<pre id="VALpolar">val polar : float -&gt; float -&gt; t</pre><div class="info ">\n<code class="code">polar norm arg</code> returns the complex having norm <code class="code">norm</code>\n    and argument <code class="code">arg</code>.<br>\n</div>\n\n<pre id="VALexp">val exp : t -&gt; t</pre><div class="info ">\nExponentiation.  <code class="code">exp z</code> returns <code class="code">e</code> to the <code class="code">z</code> power.<br>\n</div>\n\n<pre id="VALlog">val log : t -&gt; t</pre><div class="info ">\nNatural logarithm (in base <code class="code">e</code>).<br>\n</div>\n\n<pre id="VALpow">val pow : t -&gt; t -&gt; t</pre><div class="info ">\nPower function.  <code class="code">pow z1 z2</code> returns <code class="code">z1</code> to the <code class="code">z2</code> power.<br>\n</div>\n</div>'}}},pathContext:{relativePath:"api/Complex.html"}}}});
